import axios from 'axios';
import { useEffect, useState } from 'react';
import {Link} from 'react-router-dom';

const baseUrl='http://127.0.0.1:8000/api';

function UserSidebar() {

    const [studentData, setStudentData] = useState([]);

    const userId=localStorage.getItem('userId');
    
    useEffect(() => {
        try {
            axios.get(baseUrl + '/user/' + userId + '/').then((res) => {
                setStudentData(res.data)
            })
        } catch (error) {
            console.log(error)
        }
    }, [])

    if (!studentData) {
        return <div>Loading...</div>
    }

    return (
        <>
        <div className="card" id="sidebar">
          <div className="list-group list-group-flush">
          <Link to="/user-profile">
           <img src='https://static7.depositphotos.com/1003835/747/v/950/depositphotos_7470044-stock-illustration-chinese-dragon.jpg' alt="..." id="profile-img"/>
           <h5 id="sidebar-word">{studentData.full_name}</h5>
           <h5 id="sidebar-text">Студент</h5>
          </Link> 
           <Link to="/user-my-courses" id="sidebar-el" className="list-group-item list-group-item-action"><i className="bi bi-book-half" id="sidebar-it" ></i>Менің курстарым</Link>
           <Link to="/user-favorite-courses" id="sidebar-el" className="list-group-item list-group-item-action"><i className="bi bi-heart-fill" id="sidebar-it"></i>Сүйікті курстарым</Link>
           <Link to="/available-courses" id="sidebar-el" className="list-group-item list-group-item-action"><i className="bi bi-bag-fill" id="sidebar-it"></i>Ұсынылған курстар</Link>
           <Link to="/user-my-teachers" id="sidebar-el" className="list-group-item list-group-item-action"><i className="bi bi-people-fill" id="sidebar-it"></i>Мұғалімдерім</Link>
           <Link to="/user-profile-settings" id="sidebar-el" className="list-group-item list-group-item-action"><i className="bi bi-gear-fill" id="sidebar-it"></i>Баптаулар</Link>
           <Link to="/user-change-password" id="sidebar-el" className="list-group-item list-group-item-action"><i className="bi bi-person-fill-lock" id="sidebar-it"></i>Құпия сөзді өзгерту</Link>
           <Link to="#" id="sidebar-el" className="list-group-item list-group-item-action" type="button" data-bs-toggle="modal" data-bs-target="#logoutModal"><i className="bi bi-x-circle-fill" id="sidebar-it"></i>Шығу</Link>
           

<div className="modal fade" id="logoutModal" tabIndex="-1" role="dialog" aria-labelledby="exampleModalCenterLabel" aria-hidden="true">
  <div className="modal-dialog modal-dialog-centered">
    <div className="modal-content">
      <div className="modal-header">
        <h1 className="modal-title fs-5">Шығу</h1>
      </div>
      <div className="modal-body" >
        Аккаунттан шығатыныңызға сенімдісіз бе?
      </div>
      <div className="modal-footer">
        <Link to="#" type="button" id="modal-button" data-bs-dismiss="modal"><i className="bi bi-x-circle-fill"></i></Link>
        <Link to="/user-logout" id="modal-button" type="button"><i className="bi bi-check-circle-fill"></i></Link>
      </div>
    </div>
  </div>
</div>
          </div>
        </div>

        </>
    );
}
export default UserSidebar;
